import { Component, useState } from 'react';


export default function App() {

  return <div>
        <Main name= "main" ></Main>
    </div>;
}

    function Main(props) {
        return <div> <h1>Exercises</h1>
        <button onClick={
            function pushups(props){
                let [count, setCount] = useState(0)
                return <p>Pushups
                    <br />Count:{count}<br />
                    <button onClick={() => setCount(prevCount => prevCount + 1)}>Increment</button></p>
            }
        }>Push-Ups</button>
        <p>Running</p>
        <p>Jumping Jacks</p>
        <p>Cycling</p>
        <p>Situps</p>
        </div>
    }


function Pushups(props) {
    let { name } = props
    let [count, setCount] = useState(0)
    return <p>Hello {name} Function Component.
        <br/>Count:{count}<br/>
        <button onClick={() => setCount(prevCount => prevCount + 1)}>Increment</button></p>
}

class pushups extends Component {
    constructor(props){
        super(props)
        this.state = {count: 0}
    }
    render() {  
        return <p>Hello {this.props.name} Class Component</p>
    }
}
